import './App.css';
import {useState, useEffect} from "react";


// fucntions

import { getTest } from "./functions/test";

function App() {
  const[data,setData] = useState("Hello world");
  
  useEffect(() =>{
      getTest()
          .then((res) =>{
            setData(res.message);
          })
          .catch((err) => console.log(err));
  }, []);
  
  return (
    <div className="App">
      <h1>{data}</h1>
    </div>
  );
}

export default App;
